#include <iostream>
#include <stdio.h>
#include <cstdlib>

using namespace std;

void TestQuickSort(int noOfTests);
void QuickSort( int tab[], int first, int last );
void TestBubbleSort(int noOfTests);
void BubbleSort(int tab[], int tableSize);
int QS_Pivot(int tab[], int first, int last);
void Swap(int& a, int& b);
int* GetDataToSort();

int TABLE_SIZE = 10000;

int main(int argc, char *argv[])
{
	if(argc < 3)
		return 1;

	char testType = argv[1][0];
	int noOfTests = atoi(argv[2]);

	switch((int)testType)
	{
		case 'b':
			TestBubbleSort(noOfTests);
			break;
		case 'q':
			TestQuickSort(noOfTests);
			break;
		default:
			break;
	}

	return 0;
}

void TestQuickSort(int noOfTests)
{
	for(int i = 0; i<noOfTests; i++)
	{
		cout<<i<<endl;
		QuickSort(GetDataToSort(), 0, TABLE_SIZE - 1);
	}
}

void TestBubbleSort(int noOfTests)
{
	for(int i = 0; i<noOfTests; i++)
	{
		cout<<i<<endl;
		BubbleSort(GetDataToSort(), TABLE_SIZE);
	}
}

void QuickSort( int tab[], int first, int last )
{
    int pivotElement;

    if(first < last)
    {
        pivotElement = QS_Pivot(tab, first, last);
        QuickSort(tab, first, pivotElement-1);
        QuickSort(tab, pivotElement+1, last);
    }
}

void BubbleSort(int tab[], int tableSize)
{
	for(int i=tableSize-1; i>=0; i--)
	{
		for (int j=0; j<i; j++){
			if(tab[j]>tab[j+1])
			{
				Swap(tab[j], tab[j+1]);
			}
		}
	}
}

int QS_Pivot(int tab[], int first, int last)
{
    int  p = first;
    int pivotElement = tab[first];

    for(int i = first+1 ; i <= last ; i++)
    {
        /* If you want to sort the list in the other order, change "<=" to ">" */
        if(tab[i] <= pivotElement)
        {
            p++;
            Swap(tab[i], tab[p]);
        }
    }

    Swap(tab[p], tab[first]);

    return p;
}

void Swap(int& a, int& b)
{
    int temp = a;
    a = b;
    b = temp;
}

